// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/utils/Strings.sol";
import "@openzeppelin/contracts/utils/Base64.sol";

// ============ Interfaces ============

struct MutationRecord {
    string mutationType;
    bytes32 seed;
    uint256 timestamp;
}

interface ISpatters {
    function tokens(uint256) external view returns (bytes32 mintSeed, uint256 mintTimestamp);
    function getTokenMutations(uint256) external view returns (MutationRecord[] memory);
    function getCustomPalette(uint256) external view returns (string[6] memory);
    function totalSupply() external view returns (uint256);
    function ownerOf(uint256) external view returns (address);
}

/**
 * @title SpattersGenerator
 * @notice On-chain generator contract for Spatters NFTs
 * @dev Reads from SSTORE2 storage contracts and assembles complete HTML
 * 
 * Architecture inspired by Art Blocks GenArt721GeneratorV0:
 * - Separate from NFT contract for gas efficiency
 * - Called externally via web3 (not from within other contracts)
 * - Reads and concatenates multiple bytecode storage addresses
 * - Returns complete, renderable HTML documents
 */
contract SpattersGenerator {
    using Strings for uint256;
    using Strings for address;

    // ============ Immutable Storage ============

    /// @notice Address of the Spatters NFT contract
    address public immutable SPATTERS_CONTRACT;

    /// @notice Array of SSTORE2 storage addresses containing spatters.js chunks
    address[9] public STORAGE_ADDRESSES;

    /// @notice p5.js CDN URL (or address if stored on-chain in future)
    string public constant P5JS_CDN = "https://cdn.jsdelivr.net/npm/p5@1.11.2/lib/p5.min.js";

    // ============ Constructor ============

    /**
     * @notice Initialize the generator with contract references
     * @param _spattersContract Address of the Spatters NFT contract
     * @param _storageAddresses Array of 9 SSTORE2 storage addresses
     */
    constructor(
        address _spattersContract,
        address[9] memory _storageAddresses
    ) {
        require(_spattersContract != address(0), "Invalid spatters contract");

        // Verify all storage addresses are valid
        for (uint i = 0; i < 9; i++) {
            require(_storageAddresses[i] != address(0), "Invalid storage address");
        }

        SPATTERS_CONTRACT = _spattersContract;
        STORAGE_ADDRESSES = _storageAddresses;
    }

    // ============ Public Functions ============

    /**
     * @notice Generate complete HTML for a token
     * @dev Called externally via web3 - has plenty of gas for large data reads
     * @param tokenId The token ID to generate HTML for
     * @return Complete HTML document as a string
     */
    function getTokenHtml(uint256 tokenId) external view returns (string memory) {
        ISpatters spatters = ISpatters(SPATTERS_CONTRACT);

        // Verify token exists
        require(spatters.ownerOf(tokenId) != address(0), "Token does not exist");

        // 1. Read token data from Spatters contract
        (bytes32 mintSeed, uint256 mintTimestamp) = spatters.tokens(tokenId);
        MutationRecord[] memory mutations = spatters.getTokenMutations(tokenId);
        string[6] memory customPalette = spatters.getCustomPalette(tokenId);

        // 2. Read spatters.js from SSTORE2 storage (all 9 chunks)
        string memory spattersScript = _readFromSSTORE2();

        // 3. Assemble and return complete HTML
        return _buildHTML(mintSeed, mutations, customPalette, spattersScript);
    }

    /**
     * @notice Get base64-encoded data URI for HTML
     * @param tokenId The token ID
     * @return data:text/html;base64,[encoded html]
     */
    function getTokenHtmlDataUri(uint256 tokenId) external view returns (string memory) {
        string memory html = this.getTokenHtml(tokenId);

        return string(abi.encodePacked(
            'data:text/html;base64,',
            Base64.encode(bytes(html))
        ));
    }

    /**
     * @notice Get the spatters.js script from SSTORE2 storage
     * @return The complete spatters.js code as a string
     */
    function getSpattersScript() external view returns (string memory) {
        return _readFromSSTORE2();
    }

    // ============ Internal Functions ============

    /**
     * @notice Read and concatenate all spatters.js chunks from SSTORE2
     * @dev Reads from 9 storage contracts, each containing up to 24KB
     * Pattern inspired by Art Blocks' AddressChunks.mergeChunks()
     * @return The complete spatters.js script
     */
    function _readFromSSTORE2() internal view returns (string memory) {
        bytes memory fullScript;

        // Read all 9 chunks and concatenate
        for (uint i = 0; i < 9; i++) {
            address storageAddress = STORAGE_ADDRESSES[i];

            // Read data from SSTORE2 contract
            // SSTORE2 pattern: First byte is 0x00 (STOP opcode), rest is data
            bytes memory chunk;
            assembly {
                // Get the size of the code at the storage address
                let size := extcodesize(storageAddress)

                // Allocate memory for the chunk (size - 1 to skip STOP opcode)
                chunk := mload(0x40)
                mstore(0x40, add(chunk, and(add(add(size, 0x20), 0x1f), not(0x1f))))
                mstore(chunk, sub(size, 1))

                // Copy code to memory, starting at byte 1 (skip STOP opcode)
                extcodecopy(storageAddress, add(chunk, 0x20), 1, sub(size, 1))
            }

            // Concatenate chunk to full script
            fullScript = bytes.concat(fullScript, chunk);
        }

        return string(fullScript);
    }

    /**
     * @notice Build complete HTML document with all components
     * @param mintSeed The seed used to generate the artwork
     * @param mutations Array of mutation records
     * @param customPalette Custom color palette (or empty if using default)
     * @param spattersScript The complete spatters.js code
     * @return Complete HTML document
     */
    function _buildHTML(
        bytes32 mintSeed,
        MutationRecord[] memory mutations,
        string[6] memory customPalette,
        string memory spattersScript
    ) internal pure returns (string memory) {
        return string(abi.encodePacked(
            _buildHTMLHeader(),
            spattersScript,
            _buildHTMLScript(mintSeed, mutations, customPalette)
        ));
    }

    /**
     * @notice Build HTML header and p5.js include
     */
    function _buildHTMLHeader() internal pure returns (string memory) {
        return string(abi.encodePacked(
            '<!DOCTYPE html>',
            '<html><head><meta charset="UTF-8">',
            '<style>html{height:100%}body{min-height:100%;margin:0;padding:0}canvas{padding:0;margin:auto;display:block;position:absolute;top:0;bottom:0;left:0;right:0}</style>',
            '<script src="', P5JS_CDN, '"></script>',
            '</head><body><script>'
        ));
    }

    /**
     * @notice Build the main script tag with seed, mutations, and palette
     */
    function _buildHTMLScript(
        bytes32 mintSeed,
        MutationRecord[] memory mutations,
        string[6] memory customPalette
    ) internal pure returns (string memory) {
        bool hasCustomPalette = bytes(customPalette[0]).length > 0;

        string memory scriptContent = string(abi.encodePacked(
            '</script><script>',
            'const mintingSeed = hexToSeed("', _bytes32ToHex(mintSeed), '");',
            'const mutations = ', _buildMutationsArray(mutations), ';'
        ));

        if (hasCustomPalette) {
            return string(abi.encodePacked(
                scriptContent,
                'const customPalette = ', _buildPaletteArray(customPalette), ';',
                'function setup() { generate(mintingSeed, mutations, customPalette); }',
                'function hexToSeed(h) { return parseInt(h.slice(0,18),16); }',
                '</script></body></html>'
            ));
        } else {
            return string(abi.encodePacked(
                scriptContent,
                'function setup() { generate(mintingSeed, mutations); }',
                'function hexToSeed(h) { return parseInt(h.slice(0,18),16); }',
                '</script></body></html>'
            ));
        }
    }

    /**
     * @notice Build JavaScript array for custom palette
     */
    function _buildPaletteArray(string[6] memory customPalette) internal pure returns (string memory) {
        return string(abi.encodePacked(
            '["', customPalette[0], '","', customPalette[1], '","',
            customPalette[2], '","', customPalette[3], '","',
            customPalette[4], '","', customPalette[5], '"]'
        ));
    }

    /**
     * @notice Build JavaScript array of mutations
     * @param mutations Array of mutation records
     * @return JavaScript array string: [[timestamp1, "type1"], [timestamp2, "type2"], ...]
     */
    function _buildMutationsArray(MutationRecord[] memory mutations) internal pure returns (string memory) {
        if (mutations.length == 0) {
            return "[]";
        }

        string memory result = "[";
        for (uint i = 0; i < mutations.length; i++) {
            if (i > 0) result = string(abi.encodePacked(result, ","));
            result = string(abi.encodePacked(
                result,
                '["', _bytes32ToHex(mutations[i].seed), '","', mutations[i].mutationType, '"]'
            ));
        }
        return string(abi.encodePacked(result, "]"));
    }

    /**
     * @notice Convert bytes32 to hex string
     * @param data The bytes32 data to convert
     * @return Hex string representation with 0x prefix
     */
    function _bytes32ToHex(bytes32 data) internal pure returns (string memory) {
        bytes memory hexString = new bytes(66); // "0x" + 64 hex chars
        hexString[0] = "0";
        hexString[1] = "x";

        bytes memory hexAlphabet = "0123456789abcdef";

        for (uint i = 0; i < 32; i++) {
            hexString[2 + i * 2] = hexAlphabet[uint8(data[i] >> 4)];
            hexString[3 + i * 2] = hexAlphabet[uint8(data[i] & 0x0f)];
        }

        return string(hexString);
    }
}

